// components/Navbar.js
import React, { useState, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
import { getAuth, onAuthStateChanged, signOut } from "firebase/auth";
import "../css/global.css";

const Navbar = () => {
  const [menuOpen, setMenuOpen] = useState(false);
  const [user, setUser] = useState(null); // For tracking the logged-in user
  const auth = getAuth();
  const navigate = useNavigate();

  // Toggle menu for mobile view
  const toggleMenu = () => setMenuOpen(!menuOpen);

  // Handle user authentication state changes
  useEffect(() => {
    const unsubscribe = onAuthStateChanged(auth, (currentUser) => {
      setUser(currentUser); // Set user when authentication state changes
    });
    return () => unsubscribe(); // Cleanup on unmount
  }, [auth]);

  // Handle redirect to login/register page if user is not logged in
  const handleLoginRedirect = () => {
    navigate("/homepage"); // Redirect to homepage where login/register are available
  };

  // Handle user logout
  const handleLogout = async () => {
    try {
      await signOut(auth);
      setUser(null); // Clear the user state after logging out
    } catch (error) {
      console.error("Error during logout: ", error);
    }
  };

  // Close the menu when a click outside the navigation container occurs
  useEffect(() => {
    const handleClickOutside = (e) => {
      if (!e.target.closest('.nav-container')) setMenuOpen(false);
    };
    document.addEventListener('click', handleClickOutside);
    return () => document.removeEventListener('click', handleClickOutside);
  }, []);

  return (
    <header>
      <div className="nav-container">
        <div className="logo">
          <div className="logo-circle">
            <div className="logo-inner-circle"></div>
          </div>
          Celtical
        </div>

        <ul className={`nav-links ${menuOpen ? "active" : ""}`}>
          {user ? (
            // Links available when the user is logged in
            <>
              <li><Link to="/profile">Profile</Link></li>
              <li><Link to="/bookings">Book Now</Link></li>
              <li><Link to="/MyBookings">MyBookings</Link></li>
              <li><button onClick={handleLogout}>Logout</button></li> {/* Logout button */}
            </>
          ) : (
            // Links for users not logged in
            <li>
              <button onClick={handleLoginRedirect}>Please Login or Register</button>
            </li>
          )}
          <li><a href="#">Service</a></li>
          <li><a href="#">Offers</a></li>
          <li><a href="#">Contact</a></li>
        </ul>

        {/* User Icon */}
        <Link to="/HomePage" className="user-icon">
          <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24">
            <path stroke="none" d="M0 0h24v24H0z" fill="none" />
            <path d="M12 2a5 5 0 1 1 -5 5l.005 -.217a5 5 0 0 1 4.995 -4.783z" />
            <path d="M14 14a5 5 0 0 1 5 5v1a2 2 0 0 1 -2 2h-10a2 2 0 0 1 -2 -2v-1a5 5 0 0 1 5 -5h4z" />
          </svg>
          <span>{user ? user.displayName : "Login / Register"}</span>
        </Link>

        {/* Menu toggle for mobile */}
        <div className="menu-toggle" onClick={toggleMenu}>
          <span></span>
          <span></span>
          <span></span>
        </div>
      </div>
    </header>
  );
};

export default Navbar;
